  constructor(props) {
    super(props);
    this.getMatchHistory = this.getMatchHistory.bind(this);
  }

  getMatchHistory = (summoner, match) => {
    console.log("this is in app", summoner, match);
    this.setState({summoner: summoner, match: match});
  }

  // componentDidMount() {
